function preload(){

    // liste des images pour les confetti

    leschemins = ["1.png", "2.png", "3.png", "4.png", "5.png", "6.png"];

    leschemins.sort(function() {
      return 0.5 - Math.random()
    }); // vite et mauvais :-)

  console.log(leschemins);
    lesimages = [];

    while (leschemins.length) {
      lesimages.push(loadImage(leschemins.pop()));

    }

}

function setup(){


    // taille des lettres

    largeurlettre = 120;
    hauteurlettre = 200;

    createCanvas(largeurlettre * 5, hauteurlettre * 1.3);
    // background(255, 255, 255);
    noStroke();
    noLoop();

    angleMode(DEGREES);

    // Des couleurs sympas

    marron = color(50, 20, 20);
    grisclair = color(220, 220, 220);
    rouge = color(245, 0, 0);
    vert = color(0, 245, 0);
    bleu = color(0, 0, 245);
    violet = color(116, 49, 193);
    vertsapin = color(7, 131, 16);
    orange = color(255, 150, 60);
    rose = color(255, 111, 207);
    jaune = color(245, 245, 0);

    couleurs = [marron, grisclair, rouge, vert, bleu, violet, vertsapin, orange, rose, jaune];



}

function variation(seed){

    var demiecart = (seed * 0.1);
    return random(0 - demiecart, demiecart); // retourne un

}

function sample(){


    var distance = function(a, b) {
      var dx = a[0] - b[0],
        dy = a[1] - b[1];
      return Math.sqrt(dx * dx + dy * dy);
    }

    var numCandidates = 4;

    var bestCandidate, bestDistance = 0;
    for (var i = 0; i < numCandidates; ++i) {
      var c = [Math.random() * width, Math.random() * height],
        d = distance(findClosest(samples, c), c);
      if (d > bestDistance) {
        bestDistance = d;
        bestCandidate = c;
      }
    }
    return bestCandidate;

}

function barredecouleur(largeur, hauteur){


    var auhasard = floor(random(10));
    fill(couleurs[auhasard]);

    // des quad légèrement asymétriques aléatoirement, plus fun qu'un rectangle !
    quad(
      0, 0,
      largeur + variation(largeur), variation(hauteur),
      largeur + variation(largeur), hauteur + variation(hauteur),
      variation(largeur), hauteur + variation(hauteur));


}

function lettreF(){


    push();
    translate(largeurlettre * 0.3, 0);
    rotate(90)
    barredecouleur(hauteurlettre, largeurlettre / 3);
    pop();

    push();
    barredecouleur(largeurlettre, hauteurlettre / 5); // barre du haut
    translate(0, hauteurlettre / 2); // barre du milieu
    barredecouleur(largeurlettre, hauteurlettre / 5);
    pop();


}

function lettreC(){


    push();
    translate(largeurlettre * 0.3, 0);
    rotate(90);
    barredecouleur(hauteurlettre * 0.9, largeurlettre / 3);
    pop();

    push();
    barredecouleur(largeurlettre, hauteurlettre / 6); // barre du haut
    translate(0, hauteurlettre * 0.8); // barre du bas
    barredecouleur(largeurlettre, hauteurlettre / 6);
    pop();


}

function confetto(){


    imagesuivante = lesimages.pop();
    image(imagesuivante,
      0, 0,
      width / 15, width / 15); // 10% de la taille du canvas


}

function confetti(nombredeconfetti){


    // les images sont des PNG déjà masqué, 
    // mais il serait intéressant de les masquer programmatiquement
    // (pour plus de souplesses)

    for (confettonumero = 0; confettonumero < nombredeconfetti; confettonumero++) {

      push();
      translate(random(width*0.8), random(height*0.8));
      confetto();
      pop();
    }


}

function draw(){


    push();

    translate(width / 10, height / 10);
    lettreF();

    translate(largeurlettre * 1.5, 0);
    lettreC();

    translate(largeurlettre * 1.5, 0);
    lettreC();

    pop();

    confetti(lesimages.length);


}
